// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Burnable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "./ERC721Pausable.sol";

contract RetroApeClub is  Ownable, ERC721Burnable, ERC721Pausable{
    //using SafeMath for uint256;
    using Counters for Counters.Counter;
    using Strings for uint256;

    Counters.Counter private _tokenCounter;

    string private _baseTokenUri;
    string private _signerToken;
    string public placeholder;

    uint256 public maxRetroApeClub = 1000;
    uint256 public RetroApeClubPrice = 15 * 10 ** 16;
    uint256 public RetroApeClubWhitelistPrice = 1 * 10 ** 17;
    uint256 public whitelistSaleEnd;

    bool public presaleStatus = false;
    bool public isReserveMinted = false;
    bool public isRevealed = false;
    
    address financeAddress = 0x1655147A35e6Cafc1d6E587414286e6287698B7f; // address to be used 0x0000
    //address private signer;

    event mintRetroApeClub(uint256 indexed id, address minter);

    constructor(string memory baseUri, string memory _signer) ERC721("RetroApeClub", "RAC"){
        setBaseUri(baseUri);
        pause(true);
        _signerToken = _signer;
    }

    function totalSupply() public view returns(uint){
        return _tokenCounter.current();
    }
    
    function _baseURI() internal view virtual override returns (string memory) {
        return _baseTokenUri;
    }

    function tokenURI(uint256 tokenId) public view virtual override returns (string memory) {
        require(_exists(tokenId), "ERC721Metadata: URI query for nonexistent token");

        if(!isRevealed){
            return placeholder;
        }
        //string memory baseURI = _baseURI();
        return bytes(_baseTokenUri).length > 0 ? string(abi.encodePacked(_baseTokenUri, tokenId.toString())) : "";
    }

    // function walletOf()public view returns(uint256[] memory){
    //     address _owner = msg.sender;
    //     uint256 numberOfOwnedNFT = balanceOf(_owner);
    //     uint256[] memory ownerIds = new uint256[](numberOfOwnedNFT);

    //     for(uint256 index = 0; index < numberOfOwnedNFT; index++){
    //         ownerIds[index] = tokenOfOwnerByIndex(_owner, index);
    //     }

    //     return ownerIds;
    // }

    function setSigner(string memory _signer)public onlyOwner{
        _signerToken = _signer;
        return;
    }

    function setWhitelistSaleEnd(uint256 _whitelistSaleEnd)public onlyOwner{
        whitelistSaleEnd = _whitelistSaleEnd;
        return;
    }

    function setFinanceAddress(address _financeAddress)public onlyOwner{
        financeAddress = _financeAddress;
        return;
    }

    function mint(string memory _signer, uint256 _quantity) public payable{
        require(keccak256(bytes(_signer)) == keccak256(bytes(_signerToken)),"RetroApeClub: Cannot Mint Directly to Contract");
        require((totalSupply() + _quantity) <= 10 , "RetroApeClub: Cannot mint beyond max supply!");

        if(block.timestamp <= whitelistSaleEnd){
            require(msg.value >= (RetroApeClubWhitelistPrice * _quantity), "RetroApeClub: Payment is below the Price!");
            require((totalSupply() + _quantity) <= 5 , "RetroApeClub: Whitelist sale is sold out!");
        }else if(block.timestamp > whitelistSaleEnd){
            require(msg.value >= (RetroApeClubPrice * _quantity), "RetroApeClub: Payment is below the Price!");
        }

        payable(financeAddress).transfer(msg.value);
        //_mintARetroApeClub(msg.sender, _tokenCounter.current());
        for(uint256 pointer = 0; pointer < _quantity; pointer++){
            _safeMint(msg.sender, totalSupply());
            _tokenCounter.increment();
        }
        return;
    }

    function setBaseUri(string memory baseUri) public onlyOwner{
        _baseTokenUri = baseUri;
    }

    function pause(bool isPaused)public onlyOwner{
        if(isPaused == true){
            _pause();
            return;
        }
        
        _unpause();
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId
    ) internal virtual override(ERC721, ERC721Pausable) {
        super._beforeTokenTransfer(from, to, tokenId);
    }

     function supportsInterface(bytes4 interfaceId) public view virtual override(ERC721) returns (bool) {
        return super.supportsInterface(interfaceId);
    }
}
